import React from "react";
import { useContext } from "react";
import { DogContext } from "../Context/ContextProvider";
import DogsCart from "./DogsCart";

const DogsPage = () => {

  return (
    <div>
      <section className="dogs mt-3">
        <div className="row">
          {dogs &&
            dogs.map((dog) => {
              return (
                <DogsCart key={dog.id}/>
              );
            })}
        </div>
      </section>
    </div>
  );
};

export default DogsPage;
